/**
  Playlist.js
  @author Ethan Mil
  @version 1.0.0

  A React component that defines a playlist with the attributes of title (a string), artist (a string), year (an integer).
*/

import React from 'react';
import Song from './Song';
import Podcast from './Podcast';

const Playlist = () => {
  const songs = [
    { title: 'These Girls', artist: 'Sticky Fingers', year: 2013 },
    { title: 'Virginia Beach', artist: 'Drake', year: 2023 },
    { title: 'Carry On', artist: 'GRiZ', year: 2022 }
  ];


  const podcasts = [
    { episode: 352, episodeTitle: 'Episode 352' },
    { season: 5, episode: 6, episodeTitle: 'Season 5 Episode 6' },
    { episode: 50, episodeTitle: 'Episode 50' }
  ];

  return (
    <div>
      <h1>Playlist</h1>

      <h2>Songs</h2>
      {songs.map((song, index) => (
        <Song key={index} {...song} />
      ))}

      <h2>Podcasts</h2>
      {podcasts.map((podcast, index) => (
        <Podcast key={index} {...podcast} />
      ))}
    </div>
  );
}

export default Playlist;
